import { useState } from "react";

function StudioCreateEdit() {
  const [formData, setFormData] = useState({
    first_name: "",
    last_name: "",
    email: "",
    username: "",
    password: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  return (
    <div>
      <h2>Welcome! Let's build your profile.</h2>
      <form>
        <input
          type="text"
          name="first_name"
          value={first_name}
          onChange={handleChange}
        />
        <input
          type="text"
          name="first_name"
          value={first_name}
          onChange={handleChange}
        />
        <textarea
          type="text"
          name="first_name"
          value={first_name}
          onChange={handleChange}
        />
        <input
          type="text"
          name="first_name"
          value={first_name}
          onChange={handleChange}
        />
      </form>
    </div>
  );
}

export default StudioCreateEdit;
